sprites.onOverlap(SpriteKind.p1fight, SpriteKind.p2fight, function (sprite, otherSprite) {
    if (sprite.x >= otherSprite.x && sprite.y == otherSprite.y && (p1attacking == 0 && p2attacking == 0)) {
        sprite.x += sprite.x - (otherSprite.x + 8)
    } else if (sprite.x <= otherSprite.x && sprite.y == otherSprite.y && (p1attacking == 0 && p2attacking == 0)) {
        sprite.x += sprite.x - (otherSprite.x - 8)
    }
})
